<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">results :</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> nameIndex(</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">KEYED</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(name </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> searchName));</span></span>
